import React from 'react';
import { StyleSheet, Text, View, ScrollView, Image, Dimensions, ImageBackground } from 'react-native';
import HTMLView from 'react-native-htmlview';


const htmlContent = '<div class="map">Test</div>';
export default ({ history }) => (
    <ScrollView>
        <View style={{ flex: 1, justifyContent:'center'}}>
            <Text style={styles.h1}>WHERE TO FIND US</Text>
            <Text style={styles.styletext}>Durasafe Pte Ltd (HQ)</Text>
            <Text style={styles.styletext}>Durasafe@T-Space Tampines</Text>
            <Text style={styles.styletext}>1 Tampines North Drive 1 #01-39 T-Space Singapore 528559</Text>
            <Text style={styles.styletext}>Tel: (65) 6841 2224</Text>
            <Text style={styles.styletext}>Opening hours: Mon-Fri - 0900-1800, Sat â€“ 0900-1330</Text>
            <Text style={styles.styletext}>All enquiries email to: sales@durasafe.com.sg</Text>
            <HTMLView value={htmlContent}></HTMLView>
            <Text style={styles.backhome} onPress={() => history.push("/")}>BACK HOME</Text>
        </View>
    </ScrollView>
);
const styles = StyleSheet.create({
    container: {
        width: Dimensions.get('window').width - 30,
        marginTop: 20,
        height: 100,
        flex: 1,
        borderRadius: 14,
        backgroundColor: '#fff',
        justifyContent: 'center',
        alignItems: 'center'

    },
    styletext: {
        marginLeft: 5,
        marginRight: 5,
        color: '#000',
        fontSize: 15,
       
    },
    h1: {
        fontSize: 30,
        alignSelf: 'center',
        padding: 25
    },
    backhome: {
        fontSize: 20,
        alignSelf: 'center',
        padding: 25
    }
});
